(function ($) {
  "use strict";

  function appendStickyFooterToPage() {
    const sLink = window.sLink;
    if (sLink && sLink.indexOf("ttid")) {
      const paramsString = sLink.split("?").pop();
      const searchParams = new URLSearchParams(paramsString);
      const ttid = searchParams.get("ttid");
      const bannerContent = [
        `<div class="section"><div class="content"><div class="cxl-sticky-banner"><div class="column-container"><div class="container-fluid"><div class="row cxl-mb-0" role="alert" tabindex="-1"><button aria-label="Sticky Footer Close Button" id="cxl-race2refi-sticky-footer-close-button" type="button" class="btn btn-link btn-close"><span class="icon icon-xsmall icon-close"></span></button><div class="col-xs-12 col-sm-4"><h2 id="cxl-sticky-banner-heading">`,
        sTitle,
        `</h2></div><div class="col-xs-12 col-sm-6"><p id="cxl-sticky-banner-body-byline">`,
        sByLine,
        `</p><span id="cxl-sticky-banner-body-fineprint">`,
        sFinePrint,
        `</span></div><div class="col-xs-12 col-sm-2"><a id="cxl-sticky-banner-primary-cta" href="`,
        sLink,
        `" class="btn btn-primary btn-soft" data-s-object-id="`,
        sLink,
        `">`,
        sCta,
        `</a><span class="target-container" data-target-var="`,
        ttid,
        `"></span></div></div></div></div></div></div></div>`,
      ]
        .filter((segment) => segment)
        .join("");
      const homeContainer = document.querySelector(".home#container");
      homeContainer.insertAdjacentHTML("afterend", bannerContent);
    }
  }
  appendStickyFooterToPage();

  function handleStickyFooterClose() {
    const stickyFooter = document.querySelector(".cxl-sticky-banner");
    const stickyFooterCloseButton = document.getElementById(
      "cxl-race2refi-sticky-footer-close-button"
    );
    if (stickyFooterCloseButton && stickyFooter) {
      stickyFooterCloseButton.addEventListener("click", (clickEvent) => {
        clickEvent.preventDefault();
        clickEvent.stopPropagation();
        clickEvent.stopImmediatePropagation();
        stickyFooter.style.display = "none";
      });
    }
  }
  handleStickyFooterClose();

  function throttle(fn, wait) {
    var time = Date.now();
    return function () {
      if (time + wait - Date.now() < 0) {
        fn();
        time = Date.now();
      }
    };
  }

  function scrollEventListener() {
    const stripeEl = document.querySelector(".solid-color-energy-stripe");
    if (stripeEl) {
      const stripeTop = stripeEl.getBoundingClientRect().top;
      const cxlStickyBanner = document.querySelector(".cxl-sticky-banner");
      if (cxlStickyBanner && cxlStickyBanner.style) {
        cxlStickyBanner.style.position =
          window.innerHeight < stripeTop ? "fixed" : "unset";
      }
    }
  }

  function updateHeaderContent(itemToRender) {
    $("#dynamic-banner-title").html(
      itemToRender.title
        .map(
          (slitTitleLines, lineIndex) =>
            slitTitleLines.map(
              (slitWordsInLine, slitWordsIndex) =>
                '<span class="' +
                itemToRender.classes[lineIndex][slitWordsIndex] +
                '">' +
                slitWordsInLine +
                "</span>"
            ).join(" ") + "<br />"
        )
        .join("")
    );
    $("#dynamic-banner-byline").html(itemToRender.byline);
    itemToRender.tnc
      ? $("#dynamic-banner-tnc")
          .css({ display: "block" })
          .html(itemToRender.tnc)
      : $("#dynamic-banner-tnc").css({ display: "none" });
    const cta = $("#dynamic-banner-cta");
    cta.attr("href", itemToRender.ctaLink);
    cta.text(itemToRender.ctaTitle);
    $("#dynamic-banner-image").html(
      itemToRender.images
        .map(
          (image) =>
            '<source media="' + image.size + '" srcset="' + image.url + '" ></source>'
        )
        .join("") +
        '<img class="cxl-header-image" src="' +
        itemToRender.images[itemToRender.images.length - 1].url +
        '" alt="' +
        itemToRender.title +
        '" />'
    );
    $("#dynamic-banner-text-container").attr(
      "class",
      itemToRender.containerClasses
    );
  }

  function getHeaderContent() {
    const dynamicContentConainer = document.getElementById(
      "dynamic-banner-content"
    );
    if (dynamicContentConainer && dynamicContentConainer.innerText) {
      const content = JSON.parse(dynamicContentConainer.innerText);
      let pastContentPriority = +localStorage.getItem("pastContentPriority");
      const allowedItems = content.map((item) => item.priority);
      let itemToRender;
      let contentPriorityToRender = 1;
      if (allowedItems.includes(pastContentPriority)) {
        contentPriorityToRender =
          pastContentPriority < content.length ? pastContentPriority + 1 : 1;
      }
      itemToRender = content.find(
        (item) => item.priority === contentPriorityToRender
      );
      if (itemToRender) {
        localStorage.setItem("pastContentPriority", itemToRender.priority);
        updateHeaderContent(itemToRender);
      }
    }
  }

  // This handles all the animations on the page
  function initAnimations() {
    const selectorsOfElementsToAnimate = {
      "#dynamic-banner-title": {
        initial: { position: "relative", left: "-100%", opacity: 0 },
        final: { left: 0, opacity: 1 },
        duration: 1000,
        delay: 0,
      },
      "#dynamic-banner-byline": {
        initial: { position: "relative", bottom: "-75px", opacity: 0 },
        final: { bottom: 0, opacity: 1 },
        duration: 1000,
        delay: 700,
      },
      "#dynamic-banner-tnc": {
        initial: { position: "relative", bottom: "-75px", opacity: 0 },
        final: { bottom: 0, opacity: 1 },
        duration: 1000,
        delay: 700,
      },
      "#dynamic-banner-cta": {
        initial: { position: "relative", bottom: "-75px", opacity: 0 },
        final: { bottom: 0, opacity: 1 },
        duration: 1000,
        delay: 700,
      },
    };
    Object.keys(selectorsOfElementsToAnimate).forEach((selector) => {
      const config = selectorsOfElementsToAnimate[selector];
      $(selector)
        .css(config.initial)
        .delay(config.delay)
        .animate(config.final, config.duration);
    });
  }

  const throttledScrollEventListener = throttle(scrollEventListener, 300);

  setTimeout(() => {
    window.addEventListener("scroll", throttledScrollEventListener);
  }, 1000);

  getHeaderContent();
  // initAnimations();

  document.addEventListener("visibilitychange", () => {
    if (document.visibilityState === "hidden") {
      window.removeEventListener("scroll", throttledScrollEventListener);
    }
  });
})($);

